package utils

import (
	"fmt"
	"os"
	"strings"
	"testing"
)

func TestBase64Decode(t *testing.T) {
	imgStr := "data:image/png;base64,"
	imgStr = imgStr[strings.IndexByte(imgStr, ',')+1:]
	data, err := Base64Decode(imgStr)
	if err != nil {
		fmt.Println(err)
		t.Fail()
		return
	}
	err = os.WriteFile(`C:\Users\l1768\code\HelloCity\internal\utils\test.jpg`, data, 0666)
	if err != nil {
		fmt.Println(err)
		t.Fail()
		return
	}
}
